import React from 'react';
import './styles/About.css';

const About = () => {
  return (
    <section className="about">
      <h2>Sobre Nosotros</h2>
      <p>Somos una empresa familiar con más de 50 años de experiencia en la elaboración de chorizos artesanales.</p>
    </section>
  );
};

export default About;
